      products: []
    }
  }

  componentDidMount(){
    findProducts = () => {
      let url = 'https://fakestoreapi.com/products'
      fetch(url)
        .then(response => response.json())
        .then(products => console.log(products))

  }

  }





  render() {
  return (
    <div className="App">
      <header className="App-header"></header>
      <SearchBar />
      <ProductCard />
    </div>
  );
}
}

export default App;
